import React from 'react';
import { Button, TextareaAutosize} from '@material-ui/core';

function Compile() {
    return (
        <div>
            <h3>Enter the c++ code:</h3>
            <TextareaAutosize 
                rowsMin={10}
                defaultValue="hei"
            />
            <ClickButton />
        </div>
    );
}

function ClickButton(props) {
    console.log(props);

    const handleClick = () => {
        console.log("clicked");
    }
    return (
        <Button onClick={handleClick()}>
            Click me
        </Button>
    );
}
export default Compile;
